import "./App.css";
import Header from "./components/header";
import Profile from "./components/profile";
import Navbar from "./components/nav-bar";

function App() {
  return (
    <div className="container">
      <Header />
      <Navbar />
      <Profile />
    </div>
  );
}

export default App;
